pragma solidity ^0.8.0;

import "@openzeppelin/contracts-upgradeable/proxy/utils/Initializable.sol";

import "./mixins/roles/AdminTreasuryRole.sol";
import "./mixins/CollateralManagement.sol";
import "./mixins/WithdrawFromEscrow.sol";

/**
 * @notice The Minted treasury which collects fees generated by the market.
 * @dev The core responsibility of this contract is collecting fees.
 */
contract MintedTreasury is AdminTreasuryRole, CollateralManagement, WithdrawFromEscrow {

  function initialize(address admin) public initializer {
    AdminTreasuryRole._initializeAdminRole(admin);
    // emit AdminInitiated(admin);
  }
}
